import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useFormik } from 'formik';
import * as Yup from 'yup';

const Scorecard = ({ match }) => {
    const [round, setRound] = useState(null);
    const [holes, setHoles] = useState([]);
    const [leaderboard, setLeaderboard] = useState(null);

    useEffect(() => {
        const fetchRoundDetails = async () => {
            try {
                const response = await axios.get(`/api/rounds/${match.params.id}`);
                setRound(response.data.round);
                setHoles(response.data.holes);
            } catch (error) {
                console.error('Error fetching round details', error);
            }
        };

        fetchRoundDetails();
    }, [match.params.id]);

    useEffect(() => {
        const fetchLeaderboard = async () => {
            if (round && round.game_type !== 'SOLO PLAY') {
                try {
                    const response = await axios.get(`/api/rounds/${match.params.id}/leaderboard`);
                    setLeaderboard(response.data.leaderboard);
                } catch (error) {
                    console.error('Error fetching leaderboard', error);
                }
            }
        };

        fetchLeaderboard();
    }, [round, match.params.id]);

    const formik = useFormik({
        initialValues: {
            scores: holes.map(() => ({
                score: '',
                fairway_hit: false,
                green_in_regulation: false,
                putts: '',
                bunker_shots: '',
                penalties: ''
            }))
        },
        validationSchema: Yup.object({
            scores: Yup.array().of(
                Yup.object({
                    score: Yup.number().required('Required'),
                    fairway_hit: Yup.boolean(),
                    green_in_regulation: Yup.boolean(),
                    putts: Yup.number().required('Required'),
                    bunker_shots: Yup.number().required('Required'),
                    penalties: Yup.number().required('Required')
                })
            )
        }),
        onSubmit: async (values) => {
            try {
                await axios.post(`/api/rounds/${match.params.id}/scorecard`, values);
                alert('Scores submitted successfully!');
            } catch (error) {
                console.error('Error submitting scores', error);
            }
        }
    });

    if (!round || holes.length === 0) {
        return <div>Loading...</div>;
    }

    return (
        <div className="container mt-4">
            <h2>Scorecard for Round {round.id}</h2>
            <form onSubmit={formik.handleSubmit}>
                <table className="table">
                    <thead>
                        <tr>
                            <th>Hole Number</th>
                            <th>Par</th>
                            <th>Yardage</th>
                            <th>Handicap</th>
                            <th>Score</th>
                            <th>Fairway Hit</th>
                            <th>Green in Regulation</th>
                            <th>Putts</th>
                            <th>Bunker Shots</th>
                            <th>Penalties</th>
                        </tr>
                    </thead>
                    <tbody>
                        {holes.map((hole, index) => (
                            <tr key={hole.Number}>
                                <td>{hole.Number}</td>
                                <td>{hole.Par}</td>
                                <td>{hole.Length} yards</td>
                                <td>{hole.Allocation}</td>
                                <td>
                                    <input
                                        type="number"
                                        name={`scores[${index}].score`}
                                        value={formik.values.scores[index].score}
                                        onChange={formik.handleChange}
                                        onBlur={formik.handleBlur}
                                        className={`form-control ${formik.touched.scores?.[index]?.score && formik.errors.scores?.[index]?.score ? 'is-invalid' : ''}`}
                                    />
                                    {formik.touched.scores?.[index]?.score && formik.errors.scores?.[index]?.score ? (
                                        <div className="invalid-feedback">{formik.errors.scores[index].score}</div>
                                    ) : null}
                                </td>
                                <td>
                                    <input
                                        type="checkbox"
                                        name={`scores[${index}].fairway_hit`}
                                        checked={formik.values.scores[index].fairway_hit}
                                        onChange={formik.handleChange}
                                    />
                                </td>
                                <td>
                                    <input
                                        type="checkbox"
                                        name={`scores[${index}].green_in_regulation`}
                                        checked={formik.values.scores[index].green_in_regulation}
                                        onChange={formik.handleChange}
                                    />
                                </td>
                                <td>
                                    <input
                                        type="number"
                                        name={`scores[${index}].putts`}
                                        value={formik.values.scores[index].putts}
                                        onChange={formik.handleChange}
                                        onBlur={formik.handleBlur}
                                        className={`form-control ${formik.touched.scores?.[index]?.putts && formik.errors.scores?.[index]?.putts ? 'is-invalid' : ''}`}
                                    />
                                    {formik.touched.scores?.[index]?.putts && formik.errors.scores?.[index]?.putts ? (
                                        <div className="invalid-feedback">{formik.errors.scores[index].putts}</div>
                                    ) : null}
                                </td>
                                <td>
                                    <input
                                        type="number"
                                        name={`scores[${index}].bunker_shots`}
                                        value={formik.values.scores[index].bunker_shots}
                                        onChange={formik.handleChange}
                                        onBlur={formik.handleBlur}
                                        className={`form-control ${formik.touched.scores?.[index]?.bunker_shots && formik.errors.scores?.[index]?.bunker_shots ? 'is-invalid' : ''}`}
                                    />
                                    {formik.touched.scores?.[index]?.bunker_shots && formik.errors.scores?.[index]?.bunker_shots ? (
                                        <div className="invalid-feedback">{formik.errors.scores[index].bunker_shots}</div>
                                    ) : null}
                                </td>
                                <td>
                                    <input
                                        type="number"
                                        name={`scores[${index}].penalties`}
                                        value={formik.values.scores[index].penalties}
                                        onChange={formik.handleChange}
                                        onBlur={formik.handleBlur}
                                        className={`form-control ${formik.touched.scores?.[index]?.penalties && formik.errors.scores?.[index]?.penalties ? 'is-invalid' : ''}`}
                                    />
                                    {formik.touched.scores?.[index]?.penalties && formik.errors.scores?.[index]?.penalties ? (
                                        <div className="invalid-feedback">{formik.errors.scores[index].penalties}</div>
                                    ) : null}
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
                <button type="submit" className="btn btn-primary">Submit Scores</button>
            </form>

            {leaderboard && (
                <div className="mt-4">
                    <h2>Leaderboard</h2>
                    <table className="table">
                        <thead>
                            <tr>
                                <th>Golfer</th>
                                <th>Score</th>
                            </tr>
                        </thead>
                        <tbody>
                            {leaderboard.map((entry) => (
                                <tr key={entry.golfer_id}>
                                    <td>{entry.golfer_name}</td>
                                    <td>{entry.score}</td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                </div>
            )}
        </div>
    );
};

export default Scorecard;
